import React from "react";
import "./index.css";
function OurStory() {
    return (
        <div className="main-our-story">
            <div className="ourStoryImage" />
            <div className="centered">
                <h3>Our Story</h3>
                <h1>
                    ABOUT OUR AGENCY
        </h1>
                <p>Since - 2005</p>
            </div>

        </div>
    );
}

export default OurStory;
